import React, { useState } from "react";
import LandingPage from "./LandingPage";
import Home from "./Home";

function App() {
  const [showHome, setShowHome] = useState(false);

  return (
    <>
      {showHome ? <Home /> : <LandingPage onReadMore={() => setShowHome(true)} />}
    </>
  );
}

export default App;
